query:
/*+ NoHashJoin(mc t mk) */ select count(*)
from title AS t
inner join movie_companies AS mc
on t.id = mc.movie_id AND t.kind_id = 1 AND t.production_year > 2008 AND mc.company_id > 14592 AND mc.company_type_id > 1
inner join movie_keyword AS mk
on t.id = mk.movie_id AND mk.keyword_id > 2499;
